const MainPage = () => {
    return (
        <Stack sx={{ minwidth:"180px" }}
        justifyContent={"center"}
        gap={4}
    >
        <Link style={{ textDecoration: "none" }} to="/">
        <Stack ml={2} direction={"row"} alignItems={"center"} gap={1}>
            <HomeIcon sx= {{ color: "black" }} />
            <Typography sx= {{ color: "black" }} fontFamily={"monospace"} variant="h5">Home</Typography>
        </Stack>
        </Link>
        <Link style={{ textDecoration: "none" }} to="/products">
        <Stack ml={2} direction={"row"} alignItems={"center"} gap={1}>
            <InventoryIcon sx= {{ color: "black" }} />
            <Typography sx= {{ color: "black" }} fontFamily={"monospace"} variant="h5">Products</Typography>
        </Stack>
        </Link>

        <Link style={{ textDecoration: "none" }} to="/customers">
        <Stack ml={2} direction={"row"} alignItems={"center"} gap={1}>
            <PeopleIcon sx= {{ color: "black" }}/>
            <Typography sx= {{ color: "black" }} fontFamily={"monospace"} variant="h5">Customers</Typography>
        </Stack>
        </Link>
    </Stack>
    );
};

export default MainPage;
